    description:
        '<p>ЖК «Цветочные поляны» — малоэтажный жилой комплекс Новой Москвы в окружении парков. </p>\n<h2 id="расположение-и-транспортная-доступность">Расположение и транспортная доступность</h2>\n<p>Ближе 5 км к ЖК пока нет станций метро. Однако к 2025 году должны появиться новые маршруты общественного транспорта, которые позволят жителям стать мобильнее. Ориентиры для перемещений:</p>\n<ul>\n<li>Станции метро «Филатов луг», «Прокшино», «Ольховая» (открыты с 2020 года): 20 минут на автомобиле.</li>\n</ul>\n<ul>\n<li>Киевское и Калужское шоссе: 5 км.</li>\n<li>МКАД: 20 минут на транспорте (16 км). </li>\n<li>Аэропорт «Внуково»: 5 км.</li>\n</ul>\n<p>Также от ЖК идет новая дорога «Марьино — Саларьево». В 2023 году откроется новая станция метро «Внуково». </p>\n<p>Кроме того, расположение ЖК «Цветочные поляны» позволяет прогуляться до Валуевского лесопарка к северу от дома. Парк относится к особо охраняемой зеленой территории Москвы: там обитают редкие виды птиц и грызунов. </p>\n<h2 id="инфраструктура">Инфраструктура</h2>\n<p>Проект отличает продуманный ландшафтный дизайн. В центральной части ЖК «Цветочные поляны» будет парковая зона с экотропой, веревочным городком,  маршрутами для велосипедистов и лыжников, а также местами для пикников. По периметру двора — зона для прогулки с собаками. Привычные деревья и кустарники дополнят альпийские горки, живые изгороди. При каждом корпусе также будет свой двор. </p>\n<p>Дворы в ЖК «Цветочные поляны» — ожидаемо без машин, для автомобилистов появятся многоуровневый паркинг и парковка по периметру. За безопасность в ответе — охрана в одном из корпусов, круглосуточное видеонаблюдение, дымоуловители и тревожные кнопки в подъездах. В корпусах «комфорт+» дворы будут закрытыми, а вход — по магнитным карточкам. </p>\n<p>Пока в ЖК сданы 5 корпусов и работает один детский сад на 200 мест, открылись игровые площадки для детей разных возрастов, зоны для спортивных тренировок. До 2025 года появятся еще один сад и школа. </p>\n<p>На первых этажах разместятся коммерческие помещения. Также застройщик планирует возвести при ЖК «Цветочные поляны» бизнес-центр. </p>\n<h2 id="о-застройщике">О застройщике</h2>\n<p>Группа компаний «МИЦ» работает на рынке недвижимости с 1999 года и отвечает за полный цикл работ: продумывает концепции объектов, строит и сдает недвижимость, занимается эксплуатацией, курирует покупку и продажу жилья. Девелопер работает в сегментах «эконом», «комфорт» и «бизнес».</p>\n<p>В 2019 году ГК «МИЦ» вошла в список самых надежных девелоперов России по версии в Forbes. А в 2021 году — в пятерку компаний-лидеров по выводу жилья в Москве. </p>\n<p>===Архитектура и планировки===</p>\n<p>Архитектурная концепция принадлежит финскому бюро Tikkanen Architects. 14 домов высотой 8-9 этажей построены по монолитной технологии: железобетонный каркас — основа, газосиликатные блоки — в качестве стен. На лестничной клетке — по 5 квартир, в подъезде работает один лифт Otis. Вход застройщик организовал на уровне земли. Кладовые и колясочные в проект не входят.  </p>\n<p>Площадь квартир — от 21 м²  (студии) до 119 м² (4-комнатные). Застройщик предлагает целых 4 варианта отделки. Разнообразные планировки учитывают гардеробные и гостевые санузлы, в некоторых вариантах окна выходят на разные стороны света. </p>\n<p>Любители панорамных видов смогут купить квартиру в ЖК «Цветочные поляны» с увеличенным остеклением, окном в ванной комнате и даже в гардеробной. Также есть квартиры с отдельным выходом на улицу и террасами.</p>\n',
